//llamada al API

const getDataFromAPI = () => {
  fetch("https://randomuser.me/api/?results=50")
    .then((response) => response.json())
    .then((data) => {
      const cleanData = [];
      console.log(data.results);
      data.results.map((user) => {
        console.log(user.name.first);
      });
      return cleanData;
    });
};

export default getDataFromAPI;
